
public class Else_If {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a =22;
		if(a<10) {
			System.out.println("gm");
		}else if(a<18) {
			System.out.println("ga");
		}else if(a<20) {
			System.out.println("ge");
		}else {
			System.out.println("gn");
		}

	}

}
